import { Card, CardMedia, Container, Stack, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import Map from "../components/Map";

const About = () => {
  return (
    <Box display="flex" justifyContent="center" flexDirection="column">
      <Typography variant="h5" textAlign="center">
        แผนที่หจก.น้ำดื่มเพื่มพูนทรัพย์
      </Typography>
      <Container maxWidth="1024">
        <Box display="flex" gap={6} justifyContent="center" margin={4}>
          <img
            alt="map"
            src={require("../image/mappps.jpg")}
            style={{
              borderRadius: "15px",
              width: "50%",
              height: "auto",
            }}
          />
          <Map />
        </Box>
      </Container>
    </Box>
  );
};

export default About;
